import React from 'react';
import styled from 'styled-components';
import bgImage from './fondo_admin.jpg'; 

const Container = styled.div`
    display: flex;
    height: 100vh;
    width: 100vw;
    position: relative;
    background-image: url(${bgImage});
    background-size: cover;
    background-position: center;
`;

const BlurOverlay = styled.div`
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: rgba(103, 21, 125, 0.4);
    backdrop-filter: blur(15px);
    display: flex;
    justify-content: space-between;
`;

const Content = styled.div`
    flex: 1;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    color: white;
    padding: 20px;
    position: relative;
    z-index: 1;
`;


const Logo = styled.img`
    width: 200px;
    height: auto;
    margin-bottom: 5px;
`;

const Description = styled.p`
    font-size: 1.5rem;
    text-align: center;
    margin-bottom: 10px;
    font-family: 'Hint Vadodara', sans-serif;
    color: white;
`;

const FormContainer = styled.div`
    width: 90%; /* Ajuste para que ocupe el 90% del ancho de la pantalla */
    height: 70vh;
    background: rgba(255, 255, 255, 0.9);
    padding: 20px;
    border-radius: 10px;
    box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    overflow-y: auto; /* Hacer que el contenido sea desplazable */
    max-width: 90%;
`;

const Form = styled.form`
    display: flex;
    flex-direction: column;
    align-items: center;
    gap: 10px;
`;

const Label = styled.label`
    font-family: 'Hint Vadodara', sans-serif;
    color: black;
    width: 100%;
    text-align: left;
`;

const Input = styled.input`
    width: 100%;
    padding: 10px;
    border: 1px solid #ccc;
    border-radius: 5px;
    font-family: 'Hint Vadodara', sans-serif;
    background-color: #f9f9f9;
`;

const Button = styled.button`
    width: 150px;
    height: 50px;
    padding: 0px 15px;
    display: flex;
    justify-content: center;
    align-items: center;
    border-radius: 50px;
    border: none;
    background: #213B6B;
    box-shadow: 0px 4px 8px rgba(101, 91, 127, 0.3);
    color: white;
    font-family: 'Hint Vadodara', sans-serif;
    font-size: 20px;
    font-weight: 400;
    line-height: normal;
    cursor: pointer;
    word-wrap: break-word;
    margin: 10px;
    transition: background 0.3s;

    &:hover {
        background: #67157D;
    }
`;

const ButtonContainer = styled.div`
    display: flex;
    justify-content: center;
    gap: 10px;
    margin-top: 20px;
`;

const Table = styled.table`
    width: 100%;
    border-collapse: collapse;
    margin-top: 20px;
`;

const TableHeader = styled.th`
    background-color: #213B6B;
    color: white;
    padding: 10px;
    border: 1px solid #ccc;
`;

const TableData = styled.td`
    padding: 10px;
    border: 1px solid #ccc;
    text-align: center;
    color: black;
`;

const TableRow = styled.tr`
    &:nth-child(even) {
        background-color: #f2f2f2;
    }
`;

const TableWrapper = styled.div`
    overflow-x: auto;
`;

// menu latera

const SidePanel = styled.div`
    width: 250px;
    background: rgba(255, 255, 255, 0.9);
    padding: 20px;
    display: flex;
    flex-direction: column;
    align-items: center;
    border-radius: 10px;
    margin: 20px;
    box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
`;


const MenuOption = styled.button`
    width: 100%;
    padding: 10px;
    margin: 5px 0;
    background: ${props => props.disabled ? '#ccc' : '#213B6B'};
    color: white;
    border: none;
    border-radius: 5px;
    font-family: 'Hint Vadodara', sans-serif;
    cursor: ${props => props.disabled ? 'not-allowed' : 'pointer'};
    opacity: ${props => props.disabled ? 0.6 : 1};

    &:hover {
        background: ${props => props.disabled ? '#ccc' : '#67157D'};
    }
`;


const InicioEmprendedor = ({ navigate }) => {
    const handleInicioClick = () => {
        navigate('home');
    };

    const handleFormCrearClick = () => {
        navigate('crear_evaluador');
    };

    const handleAsignacionClick = () => {
        navigate('asignar_emprendimiento');
    };

    const handleSubmit = (e) => {
        e.preventDefault();
    };

    // Datos simulados del servidor
    const data = [
        {
            "_id": "668d9256a9e4591afd2ba890",
            "nombre": "Evaluador 1",
            "idIES": "66736b2317fb868463e7e60c",
            "telefono": "telEval1",
            "correo": "correoEval1@correo.com",
            "idPais": "66736b2317fb868463e7e60c"
        },
        {
            "_id": "668d943f6376d4e5b7d5c029",
            "nombre": "Evaluador 2",
            "idIES": "66736fde17fb868463e7e613",
            "telefono": "telEval2",
            "correo": "correoEval2@correo.com",
            "idPais": "66736b2317fb868463e7e60c"
        }
    ];

    return (
        <div>
            <Container>
                <BlurOverlay>
                    <Content>
                        <Logo src="logo_blanco.png" alt="Logo" />
                        <Description>Bienvenido administrador a la gestión de evaluadores</Description>

                        <FormContainer>
                            <Form onSubmit={handleSubmit}>
                                <TableWrapper>
                                    <Table>
                                        <thead>
                                            <tr>
                                                <TableHeader>Nombre</TableHeader>
                                                <TableHeader>Institución</TableHeader>
                                                <TableHeader>Teléfono</TableHeader>
                                                <TableHeader>Correo</TableHeader>
                                                <TableHeader>País</TableHeader>
                                            </tr>
                                        </thead>
                                        <tbody>
                                            {data.map((item, index) => (
                                                <TableRow key={index}>
                                                    <TableData>{item.nombre}</TableData>
                                                    <TableData>{item.idIES}</TableData>
                                                    <TableData>{item.telefono}</TableData>
                                                    <TableData>{item.correo}</TableData>
                                                    <TableData>{item.idPais}</TableData>
                                                </TableRow>
                                            ))}
                                        </tbody>
                                    </Table>
                                </TableWrapper>
                            </Form>
                        </FormContainer>

                        <ButtonContainer>
                            <Button onClick={handleFormCrearClick}>Registrar</Button>
                            <Button onClick={handleAsignacionClick}>Asignación</Button>
                            <Button onClick={handleInicioClick}>Cancelar</Button>
                        </ButtonContainer>
                    </Content>
                    <SidePanel>
                    <Logo src="logo.png" alt="Logo del Congreso" />
                    <MenuOption >Listar evaluadores</MenuOption>
                    <MenuOption >Crear evaluadores</MenuOption>
                    <MenuOption >Asignar evaluador</MenuOption>
                    <MenuOption disabled>Informes</MenuOption>
                </SidePanel>
                </BlurOverlay>
            </Container>
        </div>
    );
};

export default InicioEmprendedor;
